            this.htmlEditor1.BodyHtml = "文章示例:\r\n\r\n<div class=\" zm-editable-content clearfix\"><br>1<br><br>夏夜，风挺爽。<br><br>咕嘟咕嘟，露天一口黄铜大火锅，三人围着，吃得爽嗨。<br><br>邪乎。<br><br>有关群众都说，今天回龙观是他妈要出大事了。<br><br>不然谁他妈在公交站台吃火锅。<br><br><br><br>2<br>王小明微微一笑，捡了块儿血豆腐，那豆腐是真他妈红，和他胸口的红领巾一个色。<br><br>王小明说，我们小学生每天早晨7点早自习，6点就得起床，6点半必须上车，我们是祖国未来的花骨朵，时刻准备着，我看，以后这公交车，还是让我们孩子先上。<br><br>“放屁。”<br><br>程先生筷子一挑，卷了根粉条，不知有意无意，滑出筷尖，落在王小明脸上。<br><br>“老J8，你过分了啊。”<br><br>王小明抹把脸，手上多了把小学生圆规，铁尖子朝外。<br><br>程先生冷哼一声，两指微微使劲儿，铁筷子啪嗒断成两截，王小明有些怵。<br><br>“中关村人士，指尖之力，可以穿石。”<br><br>“那又怎样，我三年级，谈过六个女朋友。”<br><br>“这他妈没法聊天了！”<br><br>程先生一拍桌子，起身欲走，却见老者忽然抬手，脚下功夫好像一阵清风，将那姓程的摁下。<br><br>“续缘，我说你啊，就是性子急。”<br><br>老人架起二郎腿，微微抖动，捉了粒花生米，示意继续。<br><br>程先生拱手抱拳，二位，那我可就说了。<br><br>程先生表示——在我们国家，有九亿农民，伟人曾经说过，农民阶级是最进步的，我们码农，属于农民阶级的最底层，我家三代码农，根正苗红，我爷爷当年在万恶的旧社会给资本家反动派写代码，邪恶的资本家，就知道查BUG，坑害了我们一家，后来，我爹在大跃进替生产队写代码，自创土法查BUG，你去问河北老王头，谁不知道是计算机劳模，到了我这一代，还是踏踏实实写代码，要说这公交车，于情于理，都应我们先上。<br><br>一番慷慨激昂，王小明浑身一震，真个是上了一堂生动的历史课。<br><br>“你...搞计算机的？！”<br><br>“小朋友，怕了么。”<br><br>王小明紧皱眉头，内心恰有狂涛大海，半响，却是想通了。<br><br>“你答应我一件事，做到了，以后这公交车，我们小学生可以等下一班。”<br><br>“说。”<br><br>“你能不能帮我升级QQ，隔壁小刚都有两个太阳了...你要是能，公交车，你先上。”<br><br>“不能！”<br><br>如雷贯耳。<br><br>程先生昂首阔步，身躯也伟岸了许多。<br><br>“你从小就应该明白，QQ升级，要靠自己，所谓一分耕耘一分收获，只有这样，才能把小星星变成大太阳，想走捷径，我决不允许！”<br><br>“说得好，给孩子上了生动的一课！”老人赞许。<br><br>“敬酒不吃吃罚酒，信不信我红领巾勒死你！”<br><br>二人你来我往，眼看就要撕逼，只见那王小明手擒红领巾，上下翻飞，上窜下跳，化身一柄腥红宝剑，口中嗖嗖不停。<br><br>“吃我的死亡代码！”<br><br>程先生二指禅也不落下风，桌上有若键盘，两指快如电，好像真要打出一条藏满BUG的死亡代码。<br><br>一时间风云激荡，是光与火的碰撞。<br><br><br>3<br>一阵疾风。<br><br>快如骏马。<br><br>王小明与程先生只觉脸上滚烫，似是被人用老布鞋狠抽过。<br><br>那老者已经落地，提上布鞋，冷冷睥睨二人。<br><br>“无耻狗B，X你爸。”<br><br>“你这老头怎么张口就骂人呢...”<br><br>“住口！我原以为你们身为年轻狗X，来到公交站前，必有高论，没想到竟然说出如此粗鄙之语！”<br><br>“不是，老头，刚还好好的...”<br><br>天空一个响雷。<br><br>老者长袍一抖，迈出个乾坤步来，两眉一挑。<br><br>“我有一言，请诸位敬听。”<br><br>沉默。<br><br>像过了一万年那么久。<br><br>“老头，你说啊。”<br><br>“没有音乐，我说不出来。”<br><br><br>4<br>一曲《套马杆》，盎然升起，刺破了公交站的宁静，像战歌。<br><br>老者跳起了欢快的舞步，全然不似七老八十，托马斯，后空翻，机械步，样样精通。<br><br>悠然浑厚，亘古无穷，在蝴蝶振翅般的老年舞步之下，老者引吭高歌，长啸站台。<br><br>给我一个位子<br>一个威武的位子！ <br>给我一辆公交车<br>热辣滚烫。<br>坐车的老头你威武雄壮<br>飞驰的公交像疾风一样 <br>一望无际的2号线，随你去流浪！<br><br>只见好一个长衣老朽，在站台上来回跳跃，似蛟龙出海，又如大鹏穿云。<br><br>“你赢了。”<br><br>程先生黯然道，说得没错，老弱病残孕，没一个好惹。<br><br>王小明表示，老J8，这个公交站台，以后归你了。<br><br>老王微微一笑，停下舞步。<br><br>“既然如此，那以后这回龙观公交站，只许老人先上，二位，海涵！”<br><br>星空下，三人举杯共饮，公交车远远驶来，有如破开薄雾的航船，铜锅里，涮肉滋滋作响，诉说着一段传奇的过去。<br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br>5<br><br>公交站台旁，围观了全过程的一百二十个群众，默默倒退着散开。<br><br>“大家倒着走，别出声，听说傻逼都夜盲。”<br><br>“老公，那个人刚才说什么死亡代码。”<br><br>“都是智障吧，你没看见那小孩还耍红领巾吗。”<br><br>“老头跳舞的时候，真把我吓死了。”<br><br>“我已经报警了。”<br><br><br>完</div>";
